import{_ as a,c as t,a as r,o as n}from"./app-CHiHTJW6.js";const i={};function o(s,e){return n(),t("div",null,[...e[0]||(e[0]=[r(`<p>ReactNativeはどうなんだろう？</p><hr><h3 id="mac版開発日記" tabindex="-1"><a class="header-anchor" href="#mac版開発日記"><span>Mac版開発日記</span></a></h3><p><a href="https://microsoft.github.io/react-native-windows/docs/rnm-getting-started" target="_blank" rel="noopener noreferrer">ReactNative for Mac, Get Started with macOS</a></p><p>試していくと、最後の</p><div class="language-text line-numbers-mode" data-highlighter="prismjs" data-ext="text"><pre><code class="language-text"><span class="line">npx react-native run-macos</span>
<span class="line"></span></code></pre><div class="line-numbers" aria-hidden="true" style="counter-reset:line-number 0;"><div class="line-number"></div></div></div><p>で、hellorn has not been registeredとかいうエラーが出る。 ぐぐったらSOが引っかかるが、条件が違いそう（これはexpoというのを使ってるケース？） <a href="https://stackoverflow.com/questions/62649381/invariant-violation-main-has-not-been-registered" target="_blank" rel="noopener noreferrer">Invariant Violation: “main” has not been registered</a></p><p>とりあえずindex.jsでconsole.logした所、registerComponentまでは呼ばれているように見えるな。</p><p>Call StackをタップしたらVSCodeでAppRegistry.jsを開き、問題の所に入ってくるappKeyとrunnablesを出力した所、 appKeyは<code>hellorn</code>となっているが、runnablesのキーは<code>HelloRN</code>になっている。</p><p>app.jsonのnameを<code>hellorn</code>に変更してみた。</p><p>お、起動したヽ(´ー｀)ノ</p><p>よしよし、次は何したらいいかな、とMacのAPIのドキュメント見ても何も無い。 何も無いのか？と思ったが、メニューはなんか出てるんだよな。</p><p>XCodeのプロジェクトを開いたら、普通のアプリのプロジェクトっぽく実行出来る。お、これでいいんじゃね？</p><p>試しにWebViewを入れてみよう。</p><p><a href="https://github.com/react-native-webview/react-native-webview/blob/master/docs/Getting-Started.md" target="_blank" rel="noopener noreferrer">https://github.com/react-native-webview/react-native-webview/blob/master/docs/Getting-Started.md</a></p><p>動いた。リリースビルドしてみよう。</p><p>ビルド結果はどこに出来るんだ？</p><p><code>/Users/ユーザー名/Library/Developer/Xcode/DerivedData/hellorn-bddcuuqiauaopbgsggswiccvfkgm/</code> の下にあるっぽいな。</p><p>よし、見つけた。バイナリは12.6MB。まぁ100MBよりは小さいな。</p><h3 id="bulma試行錯誤" tabindex="-1"><a class="header-anchor" href="#bulma試行錯誤"><span>Bulma試行錯誤</span></a></h3><p>assetExtsにcssが無いよ、とか言われる。</p><p><a href="https://github.com/highcharts/highcharts-react-native" target="_blank" rel="noopener noreferrer">https://github.com/highcharts/highcharts-react-native</a></p><p>この辺を参考にresolverとか追記してみたらエラーは消えたが効いて無さそう？</p><p><a href="https://github.com/react-native-webview/react-native-webview/issues/1012" target="_blank" rel="noopener noreferrer">https://github.com/react-native-webview/react-native-webview/issues/1012</a></p><p>単にnpm installすれば良い、という訳では無さそうだなぁ。</p><p><a href="https://medium.com/react-native-training/improving-communication-between-react-native-webviews-and-the-webpages-they-render-792c8f7db3e5" target="_blank" rel="noopener noreferrer">Improving Communication Between React Native WebViews and the Webpages they Render</a></p>`,26)])])}const c=a(i,[["render",o]]),l=JSON.parse('{"path":"/ReactNative.html","title":"","lang":"en-US","frontmatter":{},"git":{"updatedTime":1633481528000,"contributors":[{"name":"Kazuma Arino","username":"","email":"hogeika2@gmail.com","commits":1}],"changelog":[{"hash":"af5fe721b903b25e20dba4f40b798f46324622f5","time":1633481528000,"email":"hogeika2@gmail.com","author":"Kazuma Arino","message":"update"}]},"filePathRelative":"ReactNative.md"}');export{c as comp,l as data};
